import React, { useState } from "react";
import MenuIcon from "@material-ui/icons/Menu";
import ProfileIcon from "@material-ui/icons/Person";
import { Link } from "react-router-dom";
import "../styles/BottomNavBar.scss";
import CropFreeIcon from "@material-ui/icons/CropFree";
import { updateCurrentType } from "../services/general/actions";
import { connect } from "react-redux";
import ArrowBackIosIcon from "@material-ui/icons/ArrowBackIos";

function BottomNavBar(props) {
  if (props.hub) {
    return (
      <div className="BottomNavBarWrapper">
        <ul className="BottomNavBar">
          {window.location.hash === "#/order" ? (
            <Link to="/response-list" style={{ textDecoration: "none" }}>
              <li>
                <ArrowBackIosIcon />
              </li>
            </Link>
          ) : null}
          <Link to="/menu" style={{ textDecoration: "none" }}>
            <li>
              <MenuIcon />
            </li>
          </Link>
          <Link to="/scanner" style={{ textDecoration: "none" }}>
            <li>
              <CropFreeIcon />
            </li>
          </Link>
          <Link to="/profile" style={{ textDecoration: "none" }}>
            <li>
              <ProfileIcon />
            </li>
          </Link>
        </ul>
      </div>
    );
  } else {
    return (
      <div className="BottomNavBarWrapper">
        <ul className="BottomNavBar">
          {window.location.hash === "#/order" ? (
            <Link to="/response-list" style={{ textDecoration: "none" }}>
              <li>
                <ArrowBackIosIcon />
              </li>
            </Link>
          ) : null}

          <Link to="/action-menu" style={{ textDecoration: "none" }}>
            <li>
              <MenuIcon />
            </li>
          </Link>
          <Link to="/profile" style={{ textDecoration: "none" }}>
            <li>
              <ProfileIcon />
            </li>
          </Link>
        </ul>
      </div>
    );
  }
}

function mapStateToProps(state) {
  return {
    hub: state.login.login_data.hub,
  };
}

export default connect(mapStateToProps, {
  updateCurrentType,
})(BottomNavBar);
